    setinputlist(event.target.value)
  }
  return(
    <>
      <div className='main_div'>
        <div className='center_div'>
          <br/>
          <h1>ToDo List</h1>
          <br/>
          <input type="text" placeholder='Add a items' onChange={demo}/>
          <button>+</button>

          <ol>
            <li>Buy apple</li>
          </ol>
        </div>
      </div>
    </>
  );
};

export default App;
